pub enum LocationSpecifier {
    CityAndCountryName {
        city: String,
        country: String,
    },
    CityId(String),
    Coordinates {
        lat: f32,
        lon: f32,
    },
    ZipCode {
        zip: String,
        country: String,
    },
    BoundingBox {
        lon_left: f32,
        lat_bottom: f32,
        lon_right: f32,
        lat_top: f32,
        zoom: f32,
    },
    Circle {
        lat: f32,
        lon: f32,
        count: u16,
    },
    CityIds(Vec<String>),
}

pub enum Error {
    Api(ErrorReport),
    Parsing(serde_json::Error),
    Parsing2(serde_json::Error, serde_json::Error),
    Connection(http_req::error::Error),
    Input {
        msg: String,
    },
    UrlParsing(url::ParseError),
}
